package mutate

import (
	"strings"
	"testing"
	"time"

	"github.com/davecgh/go-spew/spew"
	"github.com/stretchr/testify/require"
	"github.com/yaklang/yaklang/common/consts"
	"github.com/yaklang/yaklang/common/log"
	"github.com/yaklang/yaklang/common/yak/yaklib/codec"
)

func TestQuickMutate(t *testing.T) {
	results, err := QuickMutate("{{params(target)}}", nil, MutateWithExtraParams(map[string][]string{
		"target": {"123", "abc"},
	}))
	if err != nil {
		panic(err)
	}

	spew.Dump(results)
}

func TestQuickMutateEx(t *testing.T) {
	res, err := QuickMutateEx(`GET / HTTP/1.1
Host: www.example.com

{{rs(10,10,10)}}`, nil)
	if err != nil {
		log.Error(err)
	}
	spew.Dump(res)
}

func TestQuickMutateEx_1(t *testing.T) {
	log.Infof("start: %v", time.Now())
	defer log.Infof("end: %v", time.Now())
	res, err := QuickMutateWithCallbackEx(
		`{{rs(10,10,4)}}{{hex({{ri(10,645,222)}})}}`, consts.GetGormProfileDatabase(),
		[]func(result *MutateResult){
			func(result *MutateResult) {
				println(strings.Join(result.Payloads, ","))
			},
		},
	)
	require.NoError(t, err)
	require.Len(t, res, 888)
}

func TestQuickMutateEx_Repeated(t *testing.T) {
	log.Infof("start: %v", time.Now())
	defer log.Infof("end: %v", time.Now())
	res, err := QuickMutateWithCallbackEx(
		`{{rs(10,10,4)}}{{repeat(10)}}`, consts.GetGormProfileDatabase(),
		[]func(result *MutateResult){
			func(result *MutateResult) {
				println(strings.Join(result.Payloads, ","))
			},
		},
	)
	require.NoError(t, err)
	require.Len(t, res, 40)
}

func TestFuzzQuickMutate(t *testing.T) {
	raw, err := codec.DecodeBase64("")
	if err != nil {
		panic(err)
	}
	QuickMutate(string(raw), nil)
}
